async fn main() -> Result<()> { let node = "https://chrysalis-nodes.iota.org"; let client = Client::new_from_url(node); // Subscriber implementation does not need to specify a channel type, it will be // parsed from the announcement message let mut subscriber = Subscriber::new("SUBSCRIBER_UNIQUE_SEED", client); // Create Address object from announcement address string let ann_address = Address::from_str("Announcement link address provided by author")?; // Process the announcement message subscriber.receive_announcement(ann_address)?;
